import React, { useState, useEffect } from "react";
import { AllStars } from "./types/types";
import Dropdown from "./components/Dropdown";

const test = [
  {
    id: 669,
    name: "test",
    description: "test",
    link: "test",
  },
];

function App() {
  const [allStarsHook, setAllStarsHook] = useState<AllStars>([
    {
      id: 669,
      name: "test",
      description: "test",
      link: "test",
    },
  ]);

  const getStars = async () => {
    try {
      const apiResponse = await fetch("http://localhost:777/getStars", {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
        },
      });
      const json = await apiResponse.json();
      setAllStarsHook(json.stars);
    } catch (e) {
      console.log(e);
    }
  };

  useEffect(() => {
    getStars();
  }, []);

  return (
    <div>
      <Dropdown placeHolder="Select...." options={allStarsHook} />
      {allStarsHook?.map((star) => (
        <div key={star.id}>
          <h3>{star.id}</h3>
          <h3>{star.name}</h3>
          <h3>{star.description}</h3>
          <h3>{star.link}</h3>
        </div>
      ))}
    </div>
  );
}

export default App;
